export default class AnsL extends Component {
  render() {
  	return (
	  <ul className="list-group my-5">
	    <div className="crea-titl">
	  		<h4>multiple choice</h4>		   

    	</div>	


		  <Butt className="btn-upper mt-3" type="button"> 
							Clear Answers 
